      SELECT ALL - 26 + 82 AS col1 FROM tab0 (FORMAT parquet) WHERE + - col0 * col2 NOT IN ( col0 - + - col0 + - 79 - col2, col0 * 64 );
  - name: tab0

outputs:
  - name: q3639.out
    data: |
      56
      56
      56
